import "./Forgotpasswo.css";

const Forgotpassword = () => {
  return (
    <div className="Forgotpassword">
      <label>password</label>
      <input
        type="Password"
        className="loginInput"
        placeholder="Enter your Password..."
      />
    </div>
  );
};
export default Forgotpassword;
